import React, { Component, Fragment } from 'react';
import Navbar from '../../UI/Navbar';

import './DAOffice.css';

class Externship extends Component {
    render () {
        return (
            <Fragment>
                <div className="home-wrapper">
                    <Navbar></Navbar>
                    <div className="container">
                        <div className="content-wrapper">
                            <h5>District Attorney Externship Program</h5>
                            <p className="mt-4">The District Attorneys office provides an externship program to introduce new lawyers to the field of criminal prosecutions. Presently, in District Attorneyâ€™s offices across the state, there are many more applicants than are there open positions. We are often asked by new attorneys for the opportunity to clerk and gain valuable prosecution experience. New attorneys willing to commit to a six month externship program will do research and writing, argue motions, resolve cases on the readiness and settlement calendar, conduct preliminary hearings and when ready, will try cases before juries. They will also participate in the same training programs our lawyers are given. Our externs must pass a background check have the requisite Juris Doctor degree and be licensed to practice law in the State of California.</p>
                            <h6 className="mt-4">Testimonials</h6>
                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default Externship;
